import React, { Component } from 'react';
import ArticleList from './ArticleList';

class Home extends Component {
  render() {
    return (
      <div>
        <header>
          <h1>Welcome to NC-News!</h1>
        </header>
        <ArticleList urlPath="" />
      </div>
    );
  }
}

export default Home;
